import { Component } from '@angular/core'

@Component({
  selector: 'app-object',
  templateUrl: './object.component.html',
  styleUrls: ['./object.component.css'],
})
export class ObjectComponent {
  person: any = {
    name: 'Владимир',
    lastname: 'Ленин',
    age: 65,
    isProgrammer: true,
    languages: ['ru', 'en', 'de'],
    'complex key': 'Complex Value',
    ['key_' + (1 + 3)]: 'Computed Key',
    greet() {
      console.log('greet from person')
    },
  }
}
<h2>Примеры object из курса JS:</h2>
<p>{{ person.name }}</p>
<p>{{ person.lastname }}</p>
<p>{{ person.age }}</p>
<p>{{ person.isProgrammer }}</p>
<p>{{ person.languages }}</p>
<p>{{ person['complex key'] }}</p>
<p>{{ person['key_4'] }}</p>
<p>{{ person.greet() }}</p>
